import "./HeroImgStyles.css";

import React from "react";

import IntroImg from "../assets/intro-bg.jpeg";

const HeroImg = () => {
  return (
    <div className="hero">
      <div className="mask">
        <img className="into-img" src={IntroImg} alt="IntroImg" />
      </div>
      <div className="content"></div>
    </div>
  );
};

export default HeroImg;
